import Link from 'next/link';
import moduleName from '../assets/media/';

const LandingPage = () => {

  return (
    <div className="landing">
      <h1>HOME PAGE</h1>
      <p>Buy glasses plz</p> 
      <Link href='/shopInsta'>
        <a>SHOP INSTA</a>
      </Link>
      <Link href='/contact'>
        <a>CONTACT US</a>
      </Link>
    </div>
  );
};

export default LandingPage;
